$(function() {
    if (typeof jQuery == 'undefined') {
        let script = document.createElement("script");
        script.src = "https://code.jquery.com/jquery-3.6.0.min.js";
        script.onload = function() {
            initHeartEffect();
        };
        document.head.appendChild(script);
    } else {
        initHeartEffect();
    }

    function initHeartEffect() {
        $("<style>")
            .prop("type", "text/css")
            .html(`
                .heart-effect {
                    position: absolute;
                    font-size: 24px;
                    color: red;
                    animation: floatUp 1.2s ease-out forwards;
                    pointer-events: none;
                    opacity: 0.8;
                    transform: scale(1);
                    z-index: 9999;
                }
                @keyframes floatUp {
                    0% { transform: scale(1) translateY(0); opacity: 1; }
                    50% { transform: scale(1.6) translateY(-30px); opacity: 0.8; }
                    100% { transform: scale(1) translateY(-60px); opacity: 0; }
                }
            `)
            .appendTo("head");

        $(document).on("click", ".blike", function(e) {
            let heart = $("<span class='heart-effect'>&#10084;</span>");
            
            $(this).css('position', 'relative');
            let offset = $(this).offset();
            let x = e.pageX - offset.left;
            let y = e.pageY - offset.top;

            heart.css({ 
                top: y - 12 + "px",  
                left: x - 12 + "px", 
                position: "absolute"
            });

            $(this).append(heart);

            setTimeout(function () {
                heart.fadeOut(500, function () {
                    $(this).remove();
                });
            }, 1200);
        });
    }
});






$(document).ready(function() {
    $('<div class="fr borderg minix" style="color:gray; font-size: 16px!important; font-family:\'Ruqaa\', sans-serif; height: 26px; padding: 2px; background-color: white; text-align: right; width: auto; padding-right: 10px; display: inline-block;">' +
        'تصميم وبرمجة : <span id="typingEffect"></span>' +
        '</div>').insertBefore('div[title="المتواجدين الآن"]');

    var text = 'دمــشق هوست';
    var index = 0;

    function typeWriter() {
        if (index < text.length) {
            $('#typingEffect').html($('#typingEffect').html() + text.charAt(index));
            index++;
            setTimeout(typeWriter, 100);
        } else {
            $('#typingEffect').html('<a title="DimashkHoSt" href="https://dimashki98.github.io/madahost/" style="color:gray; font-weight:bold;">' + text + '</a>');
            setTimeout(function() {
                blinkEffect();
                setTimeout(function() {
                    index = 0;
                    $('#typingEffect').html('');
                    typeWriter();
                }, 4000);
            }, 2000);
        }
    }

    function blinkEffect() {
        $('#typingEffect').fadeOut(500).fadeIn(500, blinkEffect);
    }

    typeWriter();
});













